import './App.css';
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom';
import Home from './pages/Home';

function App() {

  return <div className="App"> 
    <Router>
    <Link to='/createpost'>
      Create A Post
    </Link>
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/createpost' exact component={Home} />
      </Switch>
    </Router>

  </div>;
}

export default App;
